import React from "react";
import Project from './Project.js';
import {readRemoteFile} from 'react-papaparse';

class Projects extends React.Component {
  constructor(props) {
    super (props);
    this.state = {
      items: [<li></li>]
    };
    this.splitter = this.splitter.bind(this);

      readRemoteFile("http://localhost:3001/projectos.csv", {
            complete: (results) => {
              this.splitter(results['data']);
              console.log(this.state.items);
            },
          });
  }

  splitter = (results) => {
    let projectsSelvIkei = ['a','a','a','a'];
    let dadosLength = results.length;
    let selvCounter = 0;
    for (let i = 1; i < dadosLength; i++) {
      if(results[i][0] == 'selv ikei '){
        projectsSelvIkei[selvCounter] = results[i][1];
        let joined = this.state.items.concat([<li>{projectsSelvIkei[selvCounter]}</li>]);
        this.setState({items:joined});
        selvCounter++;
      }
    }
    return projectsSelvIkei;
  };

  render() {
      return(
        <div id="projects">

        {this.state.items}

        </div>
      )
  }
}


export default Projects
